import React, { Component } from "react";
import firebase from "./firebase.js";

export default class CallFirebase extends Component {
  constructor(props) {
    super(props);
    this.state = {
      user: ""
    };
  }

  render() {
    return (
      <div>
        <input
          value={this.state.user}
          onChange={e => this.setState({ name: e.target.value })}
        />
      </div>
    );
  }
}
